export default class Home extends Component {

    constructor(props) {
        super(props);
        this.state = {
            invoces: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:3000/invoice")
            .then((response) => response.json())
            .then((json) => {
                json.map((item) =>
                    console.log(item),
                    this.setState({ invoces: [...this.state.invoces, item] })
                )

            });
    }

    render() {
        return (
            <div>
                {this.state.invoces}
            </div>
        )
    }
}
